import axios from "axios";

const ApiKey = "8e465ff28280979967a70c1462d19f7f"

export const getMovieList = async () => {
    const movie = await axios.get(
        `https://api.themoviedb.org/3/movie/popular?api_key=${ApiKey}`
    )

}
